import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./index.css";
//import "https://cdn.jsdelivr.net/npm/@glidejs/glide";
//import "node_modules/@glidejs/glide/dist/glide.min.js";
import Glide from "@glidejs/glide";

function Games() {
  return (
    <div>
      <div className="glide">
        <div className="glide__track" data-glide-el="track">
          <ul className="glide__slides">
            <li className="glide__slide">0</li>
            <li className="glide__slide">1</li>
            <li className="glide__slide">2</li>
          </ul>
        </div>
      </div>
      <div className="glide__arrows" data-glide-el="controls">
        <button className="glide__arrow glide__arrow--left" data-glide-dir="<">
          prev
        </button>
        <button className="glide__arrow glide__arrow--right" data-glide-dir=">">
          next
        </button>
      </div>
      <script src="https://cdn.jsdelivr.net/npm/@glidejs/glide" />
    </div>
  );
}

export default Games;
